import React from 'react';
import { Stack, TextField, Button } from '@mui/material';
// import AddUserToDB from '../Actions/AddUser';
import axios, { AxiosError } from 'axios';
import NavButtons from './NavButtons';

export default function Landing() {
    const [username, setUsername] = React.useState('');
    const [fullname, setFullname] = React.useState('');
    const newUsers = [{ username: `${username}`, fullName: `${fullname}` }];
    const handleUsername = (event) => {
        setUsername(event.target.value);
    }
    const handleFullname = (event) => {
        setFullname(event.target.value);
    }


    async function onSubmit(event) {
        try {
            await axios.post(`/api/quote/users/register`, newUsers[0]);
            return <div>{NavButtons('')}</div>;
            console.log('User added');
        }catch(error) {
            console.log(error.response.data.message);
            return 
        }
        // axios.post(`/api/quote/users/register`, newUsers[0]).catch((error) => {
        //     if (error.response) {
        //         console.log(error.response.data.message);
        //         return <h1>{error.response.data.message}</h1>;
        //     } else {
        //         return <div>{NavButtons('')}</div>;
        //     }
        // });

    }

    // const answer = addUserToDB(username, fullname);
    return (
        <>
            {/* <Box sx={{
                boxShadow: 3,
                maxWidth: '50%',
                justifyContent: 'center',
                m: 'auto',
            }}> */}
            <Stack direction="row"
                justifyContent="center"
                spacing={32}>
                <TextField
                    required
                    multiline
                    placeholder="Enter username"
                    value={username}
                    onChange={handleUsername}
                    label="Username"
                />
                <TextField
                    required
                    multiline
                    placeholder="Enter Full Name"
                    value={fullname}
                    onChange={handleFullname}
                    label="Full Name"
                />
                <Button variant="contained" color="primary" onClick={onSubmit}>Submit</Button>

                {/* {answer} */}
            </Stack>
            {/* </Box> */}
        </>
    )
}
